  fp = fopen("words.txt", "r");
  if (!fp) {
    perror("words.txt");
    return 1;
  }

  while (fscanf(fp, "\"%[^\"]\",", buf) != EOF) {
    int i, sum = 0;
    for (i = 0; buf[i] != '\0'; i++) {
      sum += buf[i]-'A'+1;
    }
    cnt += is_triangle(sum);
  }
  fclose(fp);

  printf("%d\n", cnt);

  return 0;
