int is_triangle(int c)
{
  /*
   * if c is a triangle number, c = 1/2*n*(n+1) thus n = (-1 + sqrt(1+8*c))/2 .
   * so c is a triangle number if 1+8*c is a square number and sqrt(1+8*c) is odd.
   */
  int sq = sqrt(1+8*c);
  return (sq*sq == 1+8*c && (sq & 1) == 1);
}

