int divisors_sum(int n)
{
  int sum= 1;
  int i, k = n;

  for (i = 2; i <= k; i++) {
    int p = 1;
    while (k % i == 0) {
      p *= i;
      k /= i;
    }
    sum *= (p*i - 1)/(i-1);
  }
  return sum - n;
}

