unsigned long gcd(unsigned long a, unsigned long b)
{
  unsigned long r;

  if (a > b) {
    unsigned long t = a;
    a = b;
    b = t;
  }

  while (r = a%b) {
    a = b;
    b = r;
  }
  return b;
}

unsigned long lcm(unsigned long a, unsigned long b)
{
  unsigned long long p = (unsigned long long)a * b;
  return p/gcd(a, b);
}

